<span class="line"><span style="color: #E5C07B">arr</span><span style="color: #ABB2BF">.</span><span style="color: #61AFEF">includes</span><span style="color: #ABB2BF">(</span><span style="color: #98C379">"小明"</span><span style="color: #ABB2BF">);  </span><span style="color: #7F848E; font-style: italic">// 返回 true</span></span>
